import React from 'react';

class MovieList extends React.Component {
    render() {
        return (
         <div className="movieList">
         <p>Movies</p>
         {this.props.pokemons.map(funcPoke => <Pokemon key={funcPoke.id} pokemon={funcPoke} />)}
        </div>
        );
    }
}

export default MovieList;
